import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { BrowserRouter as Router, Link, Route, Routes } from 'react-router-dom';

//import OpenAIRequest from './OpenAIRequest';
import Home from './Components/home';
import ClientList from "./Components/clientList";

import configData from "./config.json"
import "./App.css";

function App() {
   
    return (
        <div className="App">
            

            <Router>
            {/* Navbar: */}
            <nav>
                <ul className="navbar">
                    <li className="nav-item">
                        <Link to="/">Home</Link>
                    </li>
                    <li className="nav-item">
                        <Link to="/input-todo">Input Todo</Link>
                    </li>
                    <li className="nav-item">
                        <Link to="/display-todo">Display Todo</Link>
                    </li>
                    <li className="nav-item">
                        <Link to="/openai-request">OpenAI Request</Link>
                    </li>
                </ul>
            </nav>

            {/* Route configuration: */}
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/input-todo" element={<InputTodoItem />} />
                <Route path="/display-todo" element={<DisplayTodoList />} />
                <Route path="/openai-request" element={<OpenAIRequest />} />
            </Routes>
        </Router>
            <Home></Home>
            <ClientList></ClientList>

        </div>
    );
}

export default App;
